import { Grid } from "@material-ui/core";
import PhotoCard from "../components/PhotoCard";

const Content = () => {
  return (
    <Grid container spacing={16}>
      <Grid item xs={4}>
        <PhotoCard />
      </Grid>
      <Grid item xs={4}>
        <PhotoCard />
      </Grid>
      <Grid item xs={4}>
        <PhotoCard />
      </Grid>
    </Grid>
  );
};
export default Content;
